import React, { Component } from "react";
import moment from "moment";
import { Card, Table, Button, Popconfirm } from "antd";
import { keysListApi } from "../../service/keys";
import DataTable from "../../components/DataTable/DataTable";
import { compose } from "redux";
import { withRouter } from "react-router";
import { connect } from "react-redux";
import { filterKeyList, fetchKeyList } from "../../redux/actions/KeyAction";
const { Search } = Input;

class Keys extends Component {
  constructor(props) {
    super(props);
    this.state = {
      keys: [],
      isLoaded: false,
      total: 0,
    };
  }
  componentDidMount() {
    const _this = this;
    keysListApi()
      .then((res) => {
        console.log("componentDidMount-keys:", res);
        _this.setState({
          keys: res.keys,
          isLoaded: true,
          total: res.total,
        });
      })
      .catch((error) => {
        _this.setState({
          isLoaded: false,
          error: error,
        });
      });
  }
  demo = () => {
    console.log("11");
  };
  render() {
    const { filteredList, isLoading } = this.props.key;

    return (
      <Card
        title={"Key Manage Panel" + "(Total: " + filteredList.length + ")"}
        extra={
          <div>
            <Search
              placeholder="Search..."
              onChange={this.filter}
              enterButton
            />
            <Button
              style={{
                float: "right",
                paddingLeft: "10px",
                paddingLight: "10px",
              }}
              type="primary"
              onClick={this.createOpenshift}
            >
              Create
            </Button>
          </div>
        }
      >
        <DataTable
          rowKey="ID"
          columns={this.columns}
          dataSource={filteredList}
          bordered
          total={filteredList.length}
          pageSize={this.state.pageSize}
          // scroll={{ y: 600, x: 600 }}
          onPaginationChange={this.onPaginationChange}
          onShowSizeChange={this.onShowSizeChange}
          pageSizeOptions={this.state.pageSizeOptions}
          loading={isLoading}
        />
      </Card>
    );
  }
}

const mapStateToProps = ({ key }) => {
  console.log("mapStateToProps-state-key", key);
  return {
    key,
  };
};

const mapDispatchToProps = (dispatch) => {
  return {
    handleFetchKeyList: () => dispatch(fetchKeyList()),
    handleFilterKeyList: (keyword) => dispatch(filterKeyList(keyword)),
  };
};
export default compose(
  withRouter,
  connect(mapStateToProps, mapDispatchToProps)
)(Keys);
